import React, { useEffect } from "react";
import axios from "axios";

const Home = () => {
  useEffect(() => {
    axios.get;
  }, []);

  return (
    <div>
      <h1>로또콕</h1>
      <div>이번주</div>
    </div>
  );
};

export default Home;
